import { Fragment, useState } from "react"
const Couter = () =>{
   const [size, setSize] = useState({width:200, height: 100});

   return(
      <Fragment>
         <h1>너비 :{size.width} 높이 : {size.height}</h1>
         <button onClick={(event)=>{
         const copy = {...size};
         setSize(copy);
         }}>너비 변경</button>
      </Fragment>
   )
};

export default Couter;
